import React, { useEffect, useState }  from 'react'
import man from '../images/man.png'
import line from '../images/line.png'
import Header from '../header/Header'
import AdminCard from './AdminCard'


const AdminData = ({handleClick}) => {
  const [formData, setFormData] = useState([]);

  useEffect(() => {
    // Retrieve form data from localStorage
    const storedData = JSON.parse(localStorage.getItem('formData')) || [];
    setFormData(storedData);
  }, []);
  return (
    <>
    <h4 className='ms-3 mt-5'>Add Admin</h4>
    <div className="container">
     
        <div className='text-end' >
        <button onClick={handleClick} className='ps-5 pe-5 mb-5 py-2 rounded-pill' style={{backgroundColor:"black",color:"white",border:"none"}}>Add Admin</button>
     
        </div>
          <div className="row">
          <AdminCard/>
          <AdminCard/>
          <AdminCard/>
          <AdminCard/>
          <AdminCard/>
          <AdminCard/>
          <div>
      <h1>Page 2</h1>
      {formData.map((data, index) => (
        <div key={index} className="card">
          <h2>{data.name}</h2>
          <p>Email: {data.email}</p>
        </div>
      ))}
    </div>


          </div>    
    </div>

   
    </>
  )
}

export default AdminData
